import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AuthGoogleService } from 'src/app/core/services/auth-google.service';
@Component({
  selector: 'app-admin-dashboard',
  templateUrl: './admin-dashboard.component.html',
  styleUrls: ['./admin-dashboard.component.css']
})
export class AdminDashboardComponent {
  constructor(
    private authGoogleService: AuthGoogleService,
    private router: Router
  ) {

  }

  showData() {
    const data = JSON.stringify(this.authGoogleService.getProfile());
    console.log(data);

  }

  logOut() {
    this.authGoogleService.logout();
    this.router.navigate(['auth/login']);
  }
}
<p>admin-dashboard works!</p>
<button type="button" class="btn btn-success" (click)="showData()">data</button>
<button type="button" class="btn btn-danger" (click)="logOut()">close</button>
